# Delete all Electors first
Repo.delete_all(Elector)

Enum.each(electors, fn({k, v}) ->
  state = Repo.get_by(State, abbreviation: Atom.to_string(k))

  cond do
    state ->
      Enum.each(v, fn elector ->
        Elector.changeset(%Elector{}, Map.merge(elector, %{state_id: state.id}))
        |> Repo.insert!
      end)
    true ->
      IO.puts "#{Atom.to_string(k)} does not currently exist in the database."
  end
end)
